import MoviesCard from "../MoviesCard/MoviesCard";
import one from '../../../images/1.webp'
import two from '../../../images/2.webp'
import three from '../../../images/3.webp'
import four from '../../../images/4.webp'
import five from '../../../images/5.webp'
import six from '../../../images/6.webp'

function MoviesCardList({ onCardLike }) {
    return (
        <section className='cardlist'>
            <MoviesCard onCardLike={onCardLike}
                title='Девять'
                time='1ч 20м'
                poster={six} />

            <MoviesCard onCardLike={onCardLike}
                title='Тачки'
                time='1ч 20м'
                poster={five} />

            <MoviesCard onCardLike={onCardLike}
                title='Ранго'
                time='1ч 20м'
                poster={four} />

            <MoviesCard onCardLike={onCardLike}
                title='Человек-паук: через вселенные'
                time='1ч 20м'
                poster={three} />

            <MoviesCard onCardLike={onCardLike}
                title='Валл-и'
                time='1ч 20м'
                poster={two} />

            <MoviesCard onCardLike={onCardLike}
                title='Рататуй'
                time='1ч 20м'
                poster={one} />
        </section>
    )
}

export default MoviesCardList;
